import React from "react";
import Layout from "./Layout";
import Signin from "./Signin";

import CarouselComponent from "./CarouselComponent";

const Home = ({ renderLogin }) => {
  return (
    <div>
      <Layout />
      {renderLogin}
      <div className="row mt-4">
        <div className="container">
          <CarouselComponent />
        </div>
      </div>
    </div>
  );
};

export default Home;
